import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Building from "./views/building/buildingView.js";
import './App.css';


function App() {
  return (
    <BrowserRouter>
    <Switch></Switch>
      <Route exact path="/get_Buildings" component={Building} />
    </BrowserRouter>

  );
}

export default App;
